import { BigNumber } from "@ethersproject/bignumber";
import { UNIT } from "../constants";
import { getBlackScholesPrice } from "../lyra-js/src/utils/blackScholes.ts";

export const getOptionPrice = async (
  isCall,
  spotPrice,
  strikePrice,
  expiry,
  volatility
) => {
  //const PRECISION = BigNumber.from(10).pow(18);

  // Calculate time to expiry in seconds
  const timeToExpiry = Math.max(expiry - Date.now() / 1000, 0);

  // This is the implied volatility for a given strike price.
  //let volatility;

  // Calculate theoretical option price using Black-Scholes model
  const optionPrice = getBlackScholesPrice(
    timeToExpiry / (365 * 24 * 60 * 60),
    spotPrice.toString() / UNIT.toString(),
    strikePrice.toString() / UNIT.toString(),
    volatility,
    0,
    0,
    isCall
  );

  return BigNumber.from(Math.floor(optionPrice * UNIT.toString()));
};

